INSERT INTO `article` VALUES (1,'عن التطبيق ','','<div align=\"center\"><span style=\"text-align: right;\">ان السوق السعودي بحاجة الى عمل تطبيق على الهاتف المحمول الذكي ( اندرويد , &nbsp;اب ستور ) لعملية الربط بين شركات ومؤسسات مياه الشرب المعدنية والمواطنين والمقيمين لعملية تسهيل الوصول الى صاحب الحاجة لمياه الشرب والكف عن معاناة البحث بالمتاجر عن تبديل او شراء مياه الشرب المعدنية لي الشركات والمؤسسات المفضلة لديهم بالقيام بعملية توصيل هذه المياه الى منزل المواطن او المقيم او المساجد. 1</span></div>','','about','0000-00-00',0,2,0),(2,'شروط واحكام','','<div align=\"center\"><b>الشروط والأحكام</b></div><div align=\"center\"><b><br></b></div><div align=\"center\" style=\"text-align: right;\">- ان تطبيق اسقني هو ملك لشركة اسقني التجارية &nbsp;وليس للشركة &nbsp;وكلاء او شركات تعمل بإسمها بخلاف المذكورة هنا.</div><div align=\"center\" style=\"text-align: right;\">- تضمن شركة &nbsp;اسقني للتجارة أفضل خدمة ممكنة لمستخدمي التطبيق ولا يشمل هذا الضمان جودة المنتج أو خدمة عملاء شركة المياه المطلوب منها توريد الطلبات عبر التطبيق.</div><div align=\"center\" style=\"text-align: right;\">- يحق لمستخدمي التطبيق إرسال أي شكاوى او اقتراحات للشركة &nbsp;من خلال التطبيق وتتعهد الشركة &nbsp;ببذل أقصى ما يمكن من أجل تحقيق أفضل خدمة ممكنة لعملائها.</div>','','conditions','0000-00-00',0,2,0),(3,'طريقة الاستخدام','','<div align=\"center\">دينار</div><div align=\"center\">تطبيق كويتي لعرض الاعلانات المجانية بسهولة وتسوق ممتع للزوار .</div><div align=\"center\"><br></div><div align=\"center\">خدماتنا لـــــ الزائر</div><div align=\"center\">- يمكنك التسوق بكل أريحية لسهولة البحث وتوفير مايرضي الجميع .</div><div align=\"center\">- في تطبيقنا تعدد الأقسام لجميع الفئات .</div><div align=\"center\"><br></div><div align=\"center\"><br></div><div align=\"center\">خدماتنا لـــــ المعلن</div><div align=\"center\">- يمكنك عرض منتجاتك المتخلفة بجميع أقسامنا بعدد 10 اعلانات مجانيا شهريا.</div><div align=\"center\">- خدمة العروض ووالاعلانات باسعار بسيطة ( تطبق الشروط والأحكام ) .</div><div align=\"center\">-\n عرض الاعلان بكل أريحية وإضافة أكثر من صورة للاععلان لعرضها بكل وضوح \nوأيضاً بإمكانك إضافة ( وصف الاعلان - السعر&nbsp; ) لتعريفها للزوار .</div><div align=\"center\">- توفير خاصية ( التفضيل ) لتسهيل على الزائر الوصول إليك في المستقبل عن طريق قائمة الاعلاناته المفضلة .</div>','','desc','0000-00-00',0,2,0),(4,'About App','','We have world best water resources and we supply the time to time and different organization. <span style=\"color: rgb(117, 117, 117); font-family: LiberationSansRegular; font-size: 16px; background-color: rgb(247, 247, 247);\"> The brand that pioneered concept of mineral water, bottled with its distinct green label. </span>','','about','0000-00-00',0,1,0),(5,'conditions',NULL,'conditions','','conditions','0000-00-00',0,1,0),(6,'desc',NULL,'desc','','desc','0000-00-00',0,1,0);
