DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `client_id` varchar(60) NOT NULL,
  `shipping_id` varchar(60) NOT NULL,
  `order_datetime` datetime DEFAULT NULL,
  `estimate_datetime` varchar(50) DEFAULT NULL,
  `sub_total` double(11,2) NOT NULL DEFAULT '0.00',
  `tax` double(11,2) NOT NULL DEFAULT '0.00',
  `discount` double(11,2) NOT NULL DEFAULT '0.00',
  `total_amount` double(11,2) NOT NULL DEFAULT '0.00',
  `order_status` int(10) DEFAULT NULL COMMENT '1=placed,2=cancel,3=delivered,4=pending',
  `payment_type` int(10) unsigned DEFAULT NULL COMMENT '1=COD,2=EFT',
  `payment_amount` double(11,2) DEFAULT '0.00',
  `shipping_charge` double(11,2) DEFAULT '0.00',
  `transaction_id` varchar(50) DEFAULT NULL,
  `payment_method` varchar(50) DEFAULT NULL,
  `created` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `delivery_datetime` datetime DEFAULT NULL,
  `city` varchar(100) DEFAULT NULL,
  `client_name` varchar(100) DEFAULT NULL,
  `mobile` varchar(100) DEFAULT NULL,
  `street` varchar(100) DEFAULT NULL,
  `house` varchar(100) DEFAULT NULL,
  `landmark` varchar(100) DEFAULT NULL,
  `lattitude` varchar(50) DEFAULT NULL,
  `logitude` varchar(50) DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 = order, 1 = shipped, 2 = done',
  `branch_id` int(11) DEFAULT NULL,
  `otime` time DEFAULT NULL,
  `pay` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1= master , 2 = visa , 3 = k net',
  `neworder` tinyint(1) NOT NULL DEFAULT '1',
  `odate` date DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=259 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

